unction(x, y){\r\n			\r\n				htm += \'<div class=\"col-md-12 col-sm-12 col-xs-12 ac-panel panel panel-default\">\';\r\n		        htm += \'<div class=\"col-md-12 col-sm-12 col-xs-12 faqs-collapse\">\';\r\n		        htm += \'<div class=\"panel-heading faq-header-margin\">\';\r\n		        htm += \'<a class=\"_question faqs-toggle\" data=\"\'+y.id+\'\" >\';\r\n		        htm += \'<h4 class=\"panel-title faqs_panel_title\">\';\r\n		        htm += \'<span class=\"question_number\">\'+i+\'</span>\'+y.question+\'<span class=\"glyphicon arrow-faqs glyphicon-triangle-left\"></span>\';\r\n		        htm += \'</h4>\';\r\n		        htm += \'</div>\';\r\n		        htm += \'</a>\';\r\n		        htm += \'<div id=\"collapse-\'+y.id+\'\"\" class=\"collapse\">\';\r\n		        htm += \'<div class=\"panel-body faqs_body\">\'+y.answer+\'</div>\';\r\n		        htm += \'</div>\';\r\n		        htm += \'</div>\';\r\n		        htm += \'</div>\';\r\n			    \r\n				i++;\r\n			  $(\'._question\').html(htm);  \r\n			  \r\n			});\r\n		});\r\n	}\r\n	$(document).on(\'click\',\'.faqs-toggle\',function(){\r\n	$(\'.collapse\').hide();\r\n    var id = $(this).attr(\'data\');\r\n    if($(this).find(\'.arrow-faqs\').hasClass(\'glyphicon-triangle-bottom\')){\r\n      $(\'#collapse-\'+id).hide();\r\n    }\r\n    if($(\'.arrow-faqs\').hasClass(\'glyphicon-triangle-bottom\')){\r\n      $(\'.collapse\').hide();\r\n    }\r\n      $(\'.arrow-faqs\').removeClass(\'glyphicon-triangle-bottom\');\r\n      $(this).find(\'span.glyphicon\').toggleClass(\'glyphicon-triangle-bottom\');\r\n    $(\'#collapse-\'+id).toggle(\'show\');\r\n    if($(this).hasClass(\"active\")){\r\n      \r\n      $(\'#collapse-\'+id).hide();\r\n      $(this).removeClass(\"active\");\r\n      $(\'.arrow-faqs\').removeClass(\'glyphicon-triangle-bottom\');\r\n    } else {\r\n      $(\'.faqs-toggle\').removeClass(\"active\");\r\n      $(this).addClass(\"active\");\r\n    }\r\n  });\r\n});\r\n</script>\r\n<style type=\"text/css\">\r\n.related-video {\