le.log(\'Video is now loaded and playing\'); \r\n		}\r\n		myVideo.onpause = function() { \r\n			$(\'.playVideo\').show();\r\n			console.log(\'Video is now loaded and playing\'); \r\n		}\r\n	}\r\n});\r\n</script><style type=\"text/css\">\r\n.content-container {\r\n	text-align: center;\r\n	margin-top: 10px;\r\n}\r\n.con-sign-logo {\r\n	margin-top:10px;\r\n	margin-bottom:10px;\r\n}\r\n.div-small {\r\n	display: none;\r\n}\r\n\r\n/*.signup-div{\r\n	background-color: #005210;\r\n}*/\r\n.signup-header{\r\n	font-size: 36px;\r\n	color: #fef200;\r\n	text-align: center;\r\n	padding-top: 25px;\r\n}\r\n\r\n@media screen and (max-width:800px) {\r\n	.div-small img {\r\n		width: 55%;\r\n	}\r\n	.sign-up-div {\r\n		margin-top: 10px;\r\n	}\r\n\r\n}\r\n@media screen and (max-width:320px) {\r\n	.container {\r\n		padding: 0px;\r\n	}\r\n	.sign-up-div {\r\n		padding-right: 15px;\r\n		padding-left: 15px;\r\n	}\r\n	.div-small img {\r\n		width: 80%;\r\n	}\r\n}\r\n</style>\r\n<script type=\"text/javascript\" src=\"http://www.skelan.com.ph/templates/skelan/js/iframeResizer.min.js\"></script>\r\n<!--<style>iframe{width: 1px;min-width: 100%;}</style>-->\r\n<style>iframe{width: 1px;min-width: 100%; height: 670px;}</style>\r\n<!--<div id=\"signup\" class=\"signup-div\">-->\r\n<div class=\"signup-div\" style=\"display: none;\">\r\n<div class=\"container\">\r\n    	<!--<div id=\"sign-up-div\" class=\"sign-up-div col-md-12 col-sm-12 pad0\">-->\r\n<div id=\"signup\" class=\"sign-up-div col-md-12 col-sm-12 pad0\">\r\n	<!-- <p class=\"signup-header\"> SIGN UP </p>\r\n        </div> \r\n    	<div class=\"col-md-12 pad0\">\r\n    		<iframe id=\"myIframe\" frameBorder=\"0\" src=\"http://localhost/crs_qa/skelan-test-initiative-2018\" width=\"100%\" scrolling=\"no\"></iframe> -->\r\n    	</div>  	\r\n    </div>\r\n</div>\r\n\r\n \r\n<script>iFrameResize({log:true}, \'#myIframe\');</script>\r\n\r\n<script type=\"text/javascript\">\r\n	var base_url = \"http://www.skelan.com.ph/\";\r\n\r\n	\r\n	// $(\'.confirm-s